import React from "react";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import {
  Button,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Accordion,
  AccordionSummary,
  AccordionDetails,
} from "@material-ui/core";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";

export default function Order({ users }) {
  const idCurrent = JSON.parse(localStorage.getItem("username"));
  const index = users.findIndex((user) => user.id === idCurrent);
  const myProducts = index !== -1 ? users[index].myProducts : [];
  console.log(myProducts);
  return (
    <>
      <Grid container spacing={1} justifyContent="center">
        <Grid item xs={12} className="my-5 text-center">
          <Typography variant="h4" className="font-family-Ad" color="white ">
            My Products
          </Typography>
        </Grid>
        <Grid item xs={12}>
          {myProducts.map((item, index) => {
            return (
              <Accordion
                sx={{ backgroundColor: "rgba(0,0,0,0.8)" }}
                className="text-white"
              >
                <AccordionSummary
                  expandIcon={<ExpandMoreIcon sx={{ color: "white" }} />}
                  aria-controls="panel1a-content"
                  id="panel1a-header"
                >
                  <Typography>{item.id}</Typography>
                </AccordionSummary>
                <AccordionDetails>
                  <Table>
                    <TableHead>
                      <TableRow>
                        <TableCell className="text-white">STT</TableCell>
                        <TableCell className="text-white">
                          Name Product
                        </TableCell>
                        <TableCell className="text-white">Order Date</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {item.list.map((item, index) => {
                        return (
                          <TableRow key={index}>
                            <TableCell className="text-white">
                              {index + 1}
                            </TableCell>
                            <TableCell className="text-white">
                              {item.name}
                            </TableCell>
                            <TableCell className="text-white">
                              {item.orderDate}
                            </TableCell>
                          </TableRow>
                        );
                      })}
                    </TableBody>
                  </Table>
                </AccordionDetails>
              </Accordion>
            );
          })}
        </Grid>
      </Grid>
    </>
  );
}
